import React from 'react';
import './Home.css';
import pit from '../img/pit.jpg';
import login_img from '../img/login_img.jpeg';


import { BrowserRouter as Router} from "react-router-dom";

class Home2 extends React.Component {

    render() {
    return (<Router>
        <div class="home">
            <div class="nav">
            <ul>
                <li><a class="active" href="/"><img alt="sorry" height="120%" width="15%" src={pit}/></a></li>
                <li><a class="links" href="#contact">Contact</a></li>
                <li><a class="links" href="about">About</a></li>
            </ul>
            </div>
            <div class="image">
                <img alt="sorry" src={login_img} height="100%" width="100%"/>
                <a class="btn" href="/login"><span>Register/Login </span></a>
            </div>

            <div class="about">

            </div>
            <div class="contact">

            </div>    
        </div>
        </Router>
    );
    }
}
export default Home2;
